import React from 'react';
import './Footer.css';

class Footer extends React.Component {

    render() {

        return (

            <footer>
                <img src="./img/icons/logout-icon.png" alt="Logout" title="Logout" />
                <h6>Logout</h6>
            </footer>

        );

    }

}

export default Footer;
